import React from 'react';
import axios from 'axios';
import SearchBox from '../components/SearchBox';
import "./Home.css";
import logoIMG from "../components/images/Logo.gif";
import {Menuitems} from "../components/Navibar/Menuitems";
import {Link} from "react-router-dom";

class Home extends React.Component
{
  state = {
      isLoading: true,
      clicked: false
    };

    handleClick = () => {
      this.setState({clicked: !this.state.clicked});
    }

    render() 
    {  
      return (
        <div className = "group">
          <div className = "logo">
              <img 
              src = { logoIMG } 
              alt = "HWASEON"
              width = "400px"/>
          </div>
          
          <div className = "menu">
              <ul className = {this.state.clicked ? "item-clicked" : "item-unclicked" }>
                {Menuitems.map((item, index) => {
                      return (
                          <Link to = {item.path} key = {index} className = {item.cName}>
                              {item.title}
                          </Link>
                      )
                  })}
              </ul>
          </div>
        </div>  

      );
    }
  }

  export default Home;
